import React from "react";
import { Container, Row, Col } from "react-bootstrap";

function TopPage() {
	return (
		<>
			<Container>
  <Row>
    <Col>1 of 2</Col>
    <Col>2 of 2</Col>
  </Row>
  <Row>
    <Col>1 of 3</Col>
    <Col>2 of 3</Col>
    <Col>3 of 3</Col>
  </Row>
</Container>
			<div className="vh-100 d-flex justify-content-center align-items-center">
				<h1>Hello React</h1>
	 		</div>

		</>

	)
}


export default TopPage;
